#ifndef _Hazard_SpikeTrap_batches_
// Use this conveinence array to batch render all geometry by like material.
// Each entry corresponds to the same entry in the materials array above.
// The two numbers provided are the IndexCount and the IndexOffset into the indices array.
// If you need more fine grained control(ex: for transformations) use the OBJ_MESH data below.
const unsigned int Hazard_SpikeTrap_batches[2][2] =
{
	{ 600, 0 },
	{ 780, 600 },
};
#define _Hazard_SpikeTrap_batches_
#endif
#ifndef __OBJ_MESH__
typedef struct _OBJ_MESH_
{
	const char* name;
	unsigned    indexCount;
	unsigned    indexOffset;
	unsigned    materialIndex;
}OBJ_MESH;
#define __OBJ_MESH__
#endif
#ifndef _Hazard_SpikeTrap_meshes_
// Mesh Data follows: Meshes are .obj groups sorted & split by material.
// Meshes are provided in sequential order, sorted by material first and name second.
const OBJ_MESH Hazard_SpikeTrap_meshes[2] =
{
	{
		"default",
		600,
		0,
		0,
	},
	{
		"default",
		780,
		600,
		1,
	},
};
#define _Hazard_SpikeTrap_meshes_
#endif
